import React, { Fragment } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Three from "./components/three";
import Carry from "./components/carrybox/carry";
import Carry_S from "./components/carrybox/carry_shape";

const App = () => {
  const renderRouter = () => {
    return (
      <Switch>
        <Route exact path="/" component={Three} />
        <Route exact path="/carry" component={Carry} />
        <Route path="/carry_s" component={Carry_S} />
      </Switch>
    );
  }




  return (
    // <BrowserRouter>{this.renderRouter()}</BrowserRouter>
    <Fragment>5555</Fragment>
  )

}

export default App;
